import React, { useState } from 'react';

const Time = () =>{
    const state = useState();
    let Hours= new Date();
    let All = Hours.toLocaleTimeString();
    let [Sec ,loadTime] = useState(All);
    const TImeInc = () =>{
        loadTime(All);
        window.onload();
        
        
    }


    return (
        <>
        <h1>{Sec}</h1>
        <button onClick={TImeInc}>GET TIME</button>
        </>
    )
}


export default Time;
